contract FDD is ERC20, Ownable {
    using SafeMath for uint256;
    uint256 public constant MAX = ~uint256(0);
    uint256 public constant RATE_PRECISION = 1000;
    address public constant HOLE =
        address(0x000000000000000000000000000000000000dEaD);
    mapping(address => bool) private swapPairs;
    address private defaultPair;
    mapping(address => bool) private fromBlackList;
    mapping(address => bool) private fromWhiteList;
    mapping(address => bool) private toBlackList;
    mapping(address => bool) private toWhiteList;
    mapping(address => bool) private feeWhiteList;
    uint256 private minTransferAmount = 0;
    uint256 private maxTransferToSwapRate = 950;
    uint256 private tradeRewardRateLp = 30;
    address private lpAddress;
    uint256 private tradeRewardRateDao = 15;
    address private daoAddress;
    uint256 private tradeRewardRateInviters = 5;
    address private invitionHolderAddress;
    address private defaultBenefitsAddress;
    uint256 private minBenefitsRequire;
    uint256 private transferFeeRate = 20;

    constructor(
        uint256 _initialSupply,
        address _daoAddress,
        address _defaultBenefitsAddress,
        address _swapFactory,
        address _usdt,
        uint256 _swapLimit
    ) ERC20("FDD", "FDD") {
        _mint(_msgSender(), _initialSupply * (10**decimals()));
        daoAddress = _daoAddress;
        defaultBenefitsAddress = _defaultBenefitsAddress;
        if (_swapFactory != address(0)) {
            defaultPair = IUniswapV2Factory(_swapFactory).createPair(
                address(this),
                _usdt
            );
            setSwapPair(defaultPair, _swapLimit);
        }
        setFeeWhiteList(_msgSender(), true);
        fromWhiteList[HOLE] = true;
        toWhiteList[HOLE] = true;
        feeWhiteList[HOLE] = true;
        fromWhiteList[_msgSender()] = true;
        toWhiteList[_msgSender()] = true;
        feeWhiteList[_msgSender()] = true;
    }

    function setSwapPair(address _pair, uint256 _mode) public onlyOwner {
        _setSwapLimit(_pair, _mode);
        swapPairs[_pair] = true;
    }

    function _setSwapLimit(address _pair, uint256 _mode) private onlyOwner {
        if (_mode == 0) {
            fromBlackList[_pair] = true;
            toBlackList[_pair] = true;
        } else if (_mode == 1) {
            fromBlackList[_pair] = false;
            toBlackList[_pair] = false;
        } else if (_mode == 2) {
            fromBlackList[_pair] = true;
            toBlackList[_pair] = false;
        } else if (_mode == 3) {
            fromBlackList[_pair] = false;
            toBlackList[_pair] = true;
        } else {
            fromBlackList[_pair] = true;
            toBlackList[_pair] = true;
        }
    }

    function _transfer(
        address _from,
        address _to,
        uint256 _amount
    ) internal override {
        require(_from != address(0), "ERC20: transfer from the zero address");
        require(_to != address(0), "ERC20: transfer to the zero address");
        require(
            _amount >= minTransferAmount,
            "ERC20: tranfer amount can not smaller than min limit"
        );
        require(
            !fromBlackList[_from] || toWhiteList[_to],
            "ERC20: transfer refuse by sender"
        );
        require(
            !toBlackList[_to] || fromWhiteList[_from],
            "ERC20: transfer refuse by recipient"
        );
        uint256 _fee = 0;
        bool _takeFee = !isInFeeWhiteList(_from) && !isInFeeWhiteList(_to);

        bool _hasSwapPair = swapPairs[_from] || swapPairs[_to];

        if (_hasSwapPair) {
            if (_takeFee) {
                if (swapPairs[_to] && maxTransferToSwapRate < RATE_PRECISION) {
                    uint256 limit = balanceOf(_from)
                        .mul(maxTransferToSwapRate)
                        .div(RATE_PRECISION);
                    require(_amount <= limit, "ERC20: sell limit");
                }
                uint256 _feeLp = _amount.mul(tradeRewardRateLp).div(
                    RATE_PRECISION
                );
                uint256 _feeDao = _amount.mul(tradeRewardRateDao).div(
                    RATE_PRECISION
                );
                uint256 _feeInviters = _amount.mul(tradeRewardRateInviters).div(
                    RATE_PRECISION
                );
                _fee = _feeLp.add(_feeDao).add(_feeInviters);
                super._transfer(_from, lpAddress, _feeLp);
                super._transfer(_from, daoAddress, _feeDao);
                super._transfer(_from, address(this), _feeInviters);
                address _user = swapPairs[_from] ? _to : _from;
                _rewardInviters(_user, _feeInviters);
            }
        } else {
            if (_takeFee) {
                _fee = _amount.mul(transferFeeRate).div(RATE_PRECISION);
                super._transfer(_from, HOLE, _fee);
            }
        }

        super._transfer(_from, _to, _amount.sub(_fee));
    }

    // 奖励给上两代
    function _rewardInviters(address _user, uint256 _amount) private {
        if (invitionHolderAddress == address(0)) {
            super._transfer(address(this), defaultBenefitsAddress, _amount);
            return;
        }
        uint256 _amountUses = 0;
        IInvitionHolder _holder = IInvitionHolder(invitionHolderAddress);
        address _l1 = _holder.getInviterWithAccount(_user);
        address _l2 = _holder.getInviterWithAccount(_l1);
        uint256 _preInviterAmount = _amount.div(2);
        if (_l1 != address(0)) {
            _amountUses = _amountUses.add(
                _rewardInviter(_l1, _preInviterAmount)
            );
        }
        if (_l2 != address(0)) {
            _amountUses = _amountUses.add(
                _rewardInviter(_l2, _preInviterAmount)
            );
        }
        if (_amount.sub(_amountUses) > 0) {
            super._transfer(
                address(this),
                defaultBenefitsAddress,
                _amount.sub(_amountUses)
            );
        }
    }

    function _rewardInviter(address _inviter, uint256 _amount)
        private
        returns (uint256)
    {
        if (_inviter == address(0)) {
            return 0;
        }

        if (balanceOf(_inviter) < minBenefitsRequire) {
            return 0;
        }

        if (fromBlackList[_inviter] || toBlackList[_inviter]) {
            return 0;
        }

        super._transfer(address(this), _inviter, _amount);
        return _amount;
    }

    function setLpAddress(address _lpAddress) public onlyOwner {
        lpAddress = _lpAddress;
    }

    function getLpAddress() public view returns (address) {
        return lpAddress;
    }

    function setDaoAddress(address _daoAddress) public onlyOwner {
        daoAddress = _daoAddress;
    }

    function getDaoAddress() public view returns (address) {
        return daoAddress;
    }

    function setInvitionHolderAddress(address _invitionHolder)
        public
        onlyOwner
    {
        invitionHolderAddress = _invitionHolder;
    }

    function getInvitionHolderAddress() public view returns (address) {
        return invitionHolderAddress;
    }

    function setDefaultBenefitsAddress(address _defaultBenefitsAddress)
        public
        onlyOwner
    {
        defaultBenefitsAddress = _defaultBenefitsAddress;
    }

    function getDefaultBenefitsAddress() public view returns (address) {
        return defaultBenefitsAddress;
    }

    function getDefaultPair() public view returns (address) {
        return defaultPair;
    }

    function setFromBlackList(address _account, bool _status) public onlyOwner {
        fromBlackList[_account] = _status;
    }

    function isInFromBlackList(address _account) public view returns (bool) {
        return fromBlackList[_account];
    }

    function setFromWhiteList(address _account, bool _status) public onlyOwner {
        fromWhiteList[_account] = _status;
    }

    function getFromWhiteList(address _account) public view returns (bool) {
        return fromWhiteList[_account];
    }

    function setToBlackList(address _account, bool _status) public onlyOwner {
        toBlackList[_account] = _status;
    }

    function isInToBlackList(address _account) public view returns (bool) {
        return toBlackList[_account];
    }

    function setToWhiteList(address _account, bool _status) public onlyOwner {
        toWhiteList[_account] = _status;
    }

    function getToWhiteList(address _account) public view returns (bool) {
        return toWhiteList[_account];
    }

    function setFeeWhiteList(address _account, bool _status) public onlyOwner {
        feeWhiteList[_account] = _status;
    }

    function setMultipleFeeWhiteList(address[] calldata _accounts, bool _status)
        public
        onlyOwner
    {
        for (uint256 i = 0; i < _accounts.length; i++) {
            feeWhiteList[_accounts[i]] = _status;
        }
    }

    function isInFeeWhiteList(address _account) public view returns (bool) {
        return feeWhiteList[_account];
    }

    function setMinTransferAmount(uint256 _amount) public onlyOwner {
        minTransferAmount = _amount;
    }

    function getMinTransferAmount() public view returns (uint256) {
        return minTransferAmount;
    }

    function setMaxTransferToSwapRate(uint256 _rate) public onlyOwner {
        maxTransferToSwapRate = _rate;
    }

    function getMaxTransferToSwapRate() public view returns (uint256) {
        return maxTransferToSwapRate;
    }

    function setMinBenefitsRequire(uint256 _balanceRequire) public onlyOwner {
        minBenefitsRequire = _balanceRequire;
    }

    function getMinBenefitsRequire() public view returns (uint256) {
        return minBenefitsRequire;
    }
}
